import React from 'react';

const AboutUs = () => {
    return (
        <div className="container3">
            <div className="profile">
                <img src="./vivek.jpg" style={{ height: '100px', width: '100px' }} className="profile-photo" />
                <div className="profile-info container2">
                    <h2>Vivek Paghadar</h2>
                    <p>
                        Hi! I'm the developer behind SendTextAnywhere. My passion is to create user-friendly
                        applications that make communication easier for everyone. I am constantly working
                        to enhance this platform and improve your experience. Thank you for being part of our journey!
                    </p>
                </div>
            </div>
        </div>
    );
};

export default AboutUs;
